import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import "../styles/Home.css";
import "../styles/About.css";
import "../styles/Skills.css";
import "../styles/Contact.css";

function Home() {
  const [stockData, setStockData] = useState({
    symbol: "AAPL",
    price: "—",
    change: "—",
    changePercent: "—",
  });

  const [currencyData, setCurrencyData] = useState({
    base: "EUR",
    rates: { USD: "—", GBP: "—", PKR: "—" },
  });

  // ✅ Fetch currency rates
  useEffect(() => {
    fetch("http://127.0.0.1:5000/api/currency")
      .then((res) => res.json())
      .then((data) => {
        if (data && data.rates) {
          setCurrencyData({
            base: data.base,
            rates: {
              USD: data.rates.USD,
              GBP: data.rates.GBP,
              PKR: data.rates.PKR,
            },
          });
        }
      })
      .catch((err) => console.error("Error fetching currency:", err));
  }, []);

  // ✅ Fetch stock data
  useEffect(() => {
    fetch("http://127.0.0.1:5000/api/stock")
      .then((res) => res.json())
      .then((data) => setStockData(data))
      .catch((err) => console.error("Error fetching stock:", err));
  }, []);

  return (
    <div className="home-page">
      {/* Welcome Section */}
      <section id="home" className="home-welcome-section">
        <h1 className="home-welcome">Welcome to My Portfolio</h1>

        <div className="home-main">
          <div className="home-left">
            <div className="home-buttons">
              <Link to="/login" className="home-btn">Login</Link>
              <Link to="/signup" className="home-btn">Sign Up</Link>
            </div>
            <p className="home-info">
              ⚠️ This portfolio is to showcase my skills, and Login/Signup functionality
              and API fetching is totally for my Fullstack practice.{" "}
              <span className="warning">No need to create an account.</span>
            </p>
          </div>

          <div className="home-right">
            <div className="dashboard-section">
              <h2>Stock Market</h2>
              <div className="card">
                <p><strong>Symbol:</strong> {stockData.symbol}</p>
                <p><strong>Price:</strong> {stockData.price}</p>
                <p><strong>Change:</strong> {stockData.change} ({stockData.changePercent})</p>
              </div>
            </div>

            <div className="dashboard-section">
              <h2>Currency Rates (Base: {currencyData.base})</h2>
              <div className="card">
                <p><strong>USD:</strong> {currencyData.rates.USD}</p>
                <p><strong>GBP:</strong> {currencyData.rates.GBP}</p>
                <p><strong>PKR:</strong> {currencyData.rates.PKR}</p>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* About Section */}
      <section id="about" className="about-page">
        <div className="about-container">
          <h1><u>About Me</u></h1>
          <div className="about-content">
            <p><strong>Name:</strong> M. Talha Faizan</p>
            <p>
              <strong>Introduction:</strong> Hi! I am a passionate developer 
              with a keen interest in building modern web applications. 
              I love exploring new technologies, including Artificial Intelligence (AI) 
              and Machine Learning (ML), and continuously improving my skills.
            </p>
            <p>
              <strong>Purpose:</strong> This portfolio is created to showcase my projects, 
              demonstrate my abilities, and provide a platform for potential 
              collaborators or employers to get to know my work.
            </p>
            <p>
              <strong>Current:</strong> Pursuing Computer Science at UCP and working on projects.
            </p>
            <p>
              <strong>Future Goals:</strong> Full-stack developer, contribute to open source, 
              explore AI/ML, and build impactful software.
            </p>
          </div>
        </div>
      </section>

      {/* Skills Section */}
      <section id="skills" className="skills-page">
        <h1><u>My Skills</u></h1>
        <div className="skills-grid">
          {[
            {
              name: "JavaScript",
              logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/javascript/javascript-original.svg",
              link: "https://developer.mozilla.org/en-US/docs/Web/JavaScript",
              description: "Programming language for interactive web apps."
            },
            {
              name: "React",
              logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/react/react-original.svg",
              link: "https://react.dev/",
              description: "Library for building fast and dynamic UIs."
            },
            {
              name: "Python",
              logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/python/python-original.svg",
              link: "https://www.python.org/",
              description: "Versatile language for data, web, and automation."
            },
            {
              name: "Flask",
              logo: "https://cdn.simpleicons.org/flask/000000",
              link: "https://flask.palletsprojects.com/",
              description: "Lightweight Python web framework for APIs."
            }
          ].map((skill, index) => (
            <div key={index} className="skill-card">
              <img src={skill.logo} alt={`${skill.name} logo`} />
              <h2>{skill.name}</h2>
              <p className="skill-description">{skill.description}</p>
              <a href={skill.link} target="_blank" rel="noopener noreferrer">Learn more</a>
            </div>
          ))}
        </div>
      </section>

      {/* Contact Section */}
      <section id="contact" className="contact-page">
        <div className="contact-container">
          <h1><u>Contact Me</u></h1>
          <p>Email: <a href="mailto:talhafaizan513@gmail.com">talhafaizan513@gmail.com</a></p>
          <p>LinkedIn: <a href="https://linkedin.com" target="_blank" rel="noreferrer">linkedin.com</a></p>
          <p>GitHub: <a href="https://github.com" target="_blank" rel="noreferrer">github.com</a></p>
        </div>
      </section>
    </div>
  );
}

export default Home;
